export const inc1_further_information = ["An individual is considered to be in relative poverty if they are living in a household with an equivalised income below 60% of UK median income in the year in question. This is a measure of whether those in the lowest income households are keeping pace with the growth of incomes in the population as a whole.\n\nAn individual is considered to be in absolute poverty if they are living in a household with an equivalised income below 60% of the (inflation adjusted) UK median income in 2010/11. This is a measure of whether those in the lowest income households are seeing their incomes rise in real terms.\n\nPoverty can impact on health, education, living arrangements, employment opportunities and interaction with family, friends and wider society."];
export const inc1_metadata = {dataset : "INC1", table_code : "INCDEPINEQEQ", years : "2002/03 - 2022/23", start_year : "2002/03", end_year : "2022/23", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/INCDEPINEQEQ", name : "", id : "EQGRP POVERTY", email : "analyticsdivision@communities-ni.gov.uk", subject : "Deprivation and poverty", product : "Poverty", title : "Income Deprivation and Inequality", note : "Income Deprivation and Inequality\n\nHow do we measure this?\n\nLiving in Relative Poverty\nIndividuals living in a household with an equivalised income below 60% of UK median income in the year in question.\n\nLiving In Absolute Poverty\nIndividuals living with an equivalised income below 60% of the (inflation adjusted) UK median income in 2010/11.\n\nSource\nNorthern Ireland Poverty and Income Inequality Report, Department for Communities\n[url=https://www.communities-ni.gov.uk/topics/family-resources-survey]Family Resources Survey.[/url]\n\nFurther Information\nAn individual is considered to be in relative poverty if they are living in a household with an equivalised income below 60% of UK median income in the year in question. This is a measure of whether those in the lowest income households are keeping pace with the growth of incomes in the population as a whole.\n\nAn individual is considered to be in absolute poverty if they are living in a household with an equivalised income below 60% of the (inflation adjusted) UK median income in 2010/11. This is a measure of whether those in the lowest income households are seeing their incomes rise in real terms.\n\nPoverty can impact on health, education, living arrangements, employment opportunities and interaction with family, friends and wider society.\n\nSection 75 category: Age\nVariable used: Age\nBreakdown available:: 16-34; 35-49; 50-64; 65+\n\nAge is based on the age of the head of the benefit unit (family).\n\nAge bands 16-24 and 25-34 have been grouped together due to small sample sizes.\n\nSection 75 category: Men and women generally\nVariable used: Sex\nBreakdown available:: Male; Female\n\nChildren have been excluded, this data refers to adult males and adult females only.\n\nSection 75 category: Marital status\nVariable used: Marital status \nBreakdown available:: Single (never married or never in a legally registered civil partnership); Married or in a legally registered civil partnership; Separated or in a legally-recognised civil partnership and separated from civil partner; Divorced or formerly a civil partner, the civil partnership now legally dissolved; Widowed or surviving member of a legally registered civil partnership\n\nMarital status is based on the marital status of the head of the benefit unit. The subgroup co-habiting has been grouped with Married/Civil Partnership due to small sample sizes. Divorced and Separated have been grouped together due to small sample sizes.\n\nSection 75 category: Persons with a disability and persons without\nVariable used: Disability\nBreakdown available:: Disabled; Not Disabled\n\nDisability status is based on whether someone in the family has a disability / whether no-one in the family has a disability. \n\n‘Disability’ is measured using ‘limiting long-standing illness’. Respondents are defined as having a limiting long standing illness if they have any physical or mental health conditions or illnesses lasting or expected to last for 12 months or more, and the condition(s) or illness(es) reduce their ability to carry out day to day activities. The impairment types changed in 2012/13 therefore disability estimates are not directly comparable with those for years prior to 2012/13. Everyone classified as disabled under the FRS definition would also be classified as disabled under the Disability Discrimination Act (DDA). However, some individuals classified as disabled and having rights under the DDA would not be captured by this definition.\n\nSection 75 category: Religious belief\nVariable used: Religion\nBreakdown available:: Catholic; Protestant and other Christian religions\n\nReligion is based on the religion of the head of the benefit unit. Due to small sample sizes, reliable estimates are not available for the 'Other/None/Missing/Refused' category.\n\nSection 75 category: Sexual orientation\nVariable used: Sexual orientation\nBreakdown available:: Straight or heterosexual\n\nSexual orientation is based on the sexual orientation of the head of the benefit unit who is asked 'Which of the options on this card best describes how you think of yourself'? Options are: a. Heterosexual/ Straight, b. Gay/ Lesbian, c. Bisexual, d. Other.\n\nStraight or heterosexual is the only group with a large enough sample size. Due to small sample sizes, reliable estimates are not available for 'Gay/Lesbian', 'Bisexual' or 'Other'.\nData on Sexual Orientation is not available prior to 2011/12 as questions were not asked on the Family Resources Survey.\n\nSection 75 category: Persons with dependants and persons without\nVariable used: Dependants\nBreakdown available:: Has dependants (children only); Does not have dependants (children only)\n\nA 'Dependant' is an individual aged under 16. A person is also defined as a child if they are 16-19 years old and they are: not married; living with parents; and in full-time non-advanced education or in unwaged government training.\n\nSection 75 category: Racial group\nBreakdown available:: Sample sizes are too small to provide reliable estimates for this breakdown\n\nSection 75 category: Political opinion\nVariable used: Political opinion\nBreakdown available:: Unionist; Nationalist; Neither\n\nPolitical opinion is based on the political opinion of the head of the benefit unit, who is asked 'Generally speaking, do you regard yourself as a nationalist, a unionist or neither'? Data on Political opinion is not available prior to 2011/12 as questions were not asked on the Family Resources Survey."};
