export const self_how_do_we_measure = ["Percentage of people categorised as having low self-efficacy.  Self-efficacy is defined as a persons belief about their capabilities to exercise influence over events that affect their lives."];
export const self_source_name = ["Individual Wellbeing in Northern Ireland, The Executive Office"];
