export const self_further_information = ["\nSelf-efficacy is defined as a person’s belief about their capabilities to exercise influence over events that affect their lives.\n\nThose with low self-efficacy often doubt their capabilities, are less ambitious and give up on aims when challenged. This can limit the choices a person makes and how much effort they are willing to invest.\n\nThe tool for measuring self-efficacy is a simple statement-based survey tool. It takes the form of five simple statements to which the individual indicates to what extent they agree or disagree on a five-point Likert scale. Self-efficacy is then presented as an overall score, minimum 5 and maximum 25, taken from the summed total of the five statement questions. Self-efficacy scores of 70% or more of the total possible score (i.e. 18 to 25) are categorised as high self-efficacy; low self-efficacy is therefore anything under 70% of the total possible score (i.e. 5 to 17).\n\nData refers to the percentage of the population aged 16 and over.\n\nSome figures have been suppressed due to small sample sizes (less than 100 respondents).\nAll estimates for mean scores and percentages are based on weighted data and have been rounded to one decimal place.\n\nThe coronavirus pandemic resulted in a change in data collection mode and a reduced sample size for 2020/21. Users should therefore take this into consideration when interpreting any subsequent years of data, and care should be taken when comparing findings published prior to 2020/21.\n\nData is collected through Continuous Household Survey (CHS).\n\nThe sample size for 2017/18, 2018/19 and 2019/20 was approximately double that of previous years.\n\nSome figures have been suppressed due to small sample sizes (less than 100 respondents), missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed."];
