export const shar_further_information = ["\nThe source for this indicator is the Northern Ireland Life and Times Survey (NILT) which is an attitudinal survey that takes place at a particular point in the year. One-off events of a particular local or national level occurring during, or close to the survey's fieldwork period may impact results and create volatility from year to year.\n\nTo account for sampling error, the data have been weighted by age, gender, and location, based on the most recently available Census data.\n\nIn 2020, the NILT survey was moved from an in-person interviewer-led survey to a combination of CAWI (Computer Assisted Web Interviewing) and CATI (Computer Assisted Telephone Interviewing) - the new format has been used in every year since 2020.\n\nRespondents to this survey were asked: ‘If you had a choice, would you prefer to live in a neighbourhood with people of only your own religion, or in a mixed-religion neighbourhood?'\n\nSome figures have been suppressed due to small sample sizes, missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed."];
