export const cult_further_information = ["\nThe source for this indicator is the Northern Ireland Life and Times Survey (NILT) which is an attitudinal survey that takes place at a particular point in the year. One-off events of a particular local or national level occurring during, or close to the survey's fieldwork period may impact results and create volatility from year to year.\n\nTo account for sampling error, the data have been weighted by age, gender, and location, based on the most recently available Census data.\n\nIn 2020, the NILT survey was moved from an in-person interviewer-led survey to a combination of CAWI (Computer Assisted Web Interviewing) and CATI (Computer Assisted Telephone Interviewing) - the new format has been used in every year since 2020.\n\nCultural Identity is defined within the Northern Ireland Life and Times (NILT) survey as “things like your ethnicity, nationality, religious or political background”.\n\nRespondents who say strongly agree or agree are included.\n\nSome figures have been suppressed due to small sample sizes, missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed."];
export const cult_metadata = {dataset : "CULT", table_code : "CULTIDEQ", years : "2014 - 2022", start_year : "2014", end_year : "2022", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/CULTIDEQ", name : "PfG Analytics, The Executive Office", id : "EQGRP", email : "pfganalytics@executiveoffice-ni.gov.uk", subject : "Community", product : "Community relations", title : "Respected Cultural Identity", note : "Respected Cultural Identity\n\nHow do we measure this?\nPercentage of the population aged 18+ who believe their cultural identity is respected by society.\n\nSource\n[url=https://www.executiveoffice-ni.gov.uk/topics/statistics-and-research/good-relations]Good Relations Indicators Report, The Executive Office.[/url] \n\nFurther information\r\n\nThe source for this indicator is the Northern Ireland Life and Times Survey (NILT) which is an attitudinal survey that takes place at a particular point in the year. One-off events of a particular local or national level occurring during, or close to the survey's fieldwork period may impact results and create volatility from year to year.\n\nTo account for sampling error, the data have been weighted by age, gender, and location, based on the most recently available Census data.\n\nIn 2020, the NILT survey was moved from an in-person interviewer-led survey to a combination of CAWI (Computer Assisted Web Interviewing) and CATI (Computer Assisted Telephone Interviewing) - the new format has been used in every year since 2020.\n\nCultural Identity is defined within the Northern Ireland Life and Times (NILT) survey as “things like your ethnicity, nationality, religious or political background”.\n\nRespondents who say strongly agree or agree are included.\n\nSome figures have been suppressed due to small sample sizes, missing values are denoted as ‘..’ or a blank space depending on the format it is being viewed.\n\nSection 75 category: Age\nVariable used: Age\nBreakdown available:: 18-24; 25-34; 35-49; 50-64; 65+\n\nSection 75 category: Men and women generally\nVariable used: Sex\nBreakdown available:: Female; Male\n\nSection 75 category: Marital status\nVariable used: Marital status\nBreakdown available:: Single; Married/Civil partnership; Separated; Divorced; Widowed\n\nThe definition of marital status in the Northern Ireland Life & Times survey does not include 'cohabiting' as a classification.\n\nSection 75 category: Persons with a disability and persons without\nVariable used: Disability\nBreakdown available:: Disabled; Not Disabled\n\n‘[u]Disability[/u]’ is measured using ‘limiting long-standing illness’. Respondents are defined as having a limiting long standing illness if they have any physical or mental health conditions or illnesses lasting or expected to last for 12 months or more, and the condition(s) or illness(es) reduce their ability to carry out day to day activities.\n\nSection 75 category: Religious belief\nVariable used: Religion\nBreakdown available:: Catholic; Protestant; Other/no religion \n\n‘[u]Catholic[/u]’ includes the category 'Catholic'.\n‘[u]Protestant[/u]’ includes the categories: 'Church of Ireland/Anglican/Episcopal', 'Baptist', 'Methodist', 'Presbyterian', 'Free Presbyterian', 'Brethren', 'United Reform Church (URC)/Congregational', 'Pentecostal', 'Church of Scotland', 'Elim Pentecostal', 'Reformed Presbyterian', 'Non-subscribing Presbyterian', 'Salvation Army', 'Church of Nazarene', 'Other Protestant, specify'.\n‘[u]Other/no religion[/u]’ includes the categories: 'No religion', 'Jehovah's Witness', 'Church of Jesus Christ of Latter Day Saints (Mormon)', 'Other Christian, specify', 'Hindu', 'Jewish', 'Islam/Muslim', 'Sikh', 'Buddhist', 'Other (WRITE IN)', 'Don`t know', 'Not answered/Refused'.\n\nSection 75 category: Sexual orientation\nVariable used: Sexual orientation\nBreakdown available:: Straight or heterosexual; Gay, lesbian, bisexual or other sexual orientation\n\nSection 75 category: Persons with dependants and persons without\nBreakdown available:: These data are not collected by the survey\n\nSection 75 category: Racial group\nVariable used: Ethnic Group\nBreakdown available:: White; Other\n\n‘[u]Other[/u]' includes: 'Irish Traveller'; 'Indian'; 'Pakistani'; 'Bangladeshi'; 'Chinese'; 'Any other Asian background'; 'Black African'; 'Black Caribbean'; 'Any other mixed/multiple ethnic background'; and 'Any other ethnic group'.\n\nSection 75 category: Political opinion\nVariable used: Political opinion\nBreakdown available:: Unionist; Nationalist; Neither\n\nRespondents are asked - ‘Generally speaking, do you think of yourself as a unionist, a nationalist or neither’? and responses are coded as 'Unionist', 'Nationalist', 'Neither', 'Other' or 'Don`t know'.\n'[u]Neither[/u]' category includes 'Neither', 'Other', 'Don’t know' , 'Not answered/Refused' and, after 2020, 'Prefer not to say'."};
