export const c5011_further_information = ["\nCensus 2021 included a suite of questions which were asked of everyone aged 16 and over to determine their economic status. This information led to a three-way classification of economic status:\n\nEconomically active: in employment (an employee, self-employed or full-time student in employment).\n\nEconomically active: unemployed (those who were looking for work and could start within two weeks, or waiting to start a job that had been offered and accepted).\n\nEconomically inactive: (those who did not have a job between 15 March and 21 March 2021 and had not looked for work between 22 February and 21 March 2021 or could not start within two weeks).\n\nThose who were economically inactive were recorded as one of the following statuses: retired, studying,\nlooking after home or family, long-term sick or disabled, or other.\n\nThese accredited official statistics were independently reviewed by the Office for Statistics Regulation in May 2022. They comply with the standards of trustworthiness, quality and value in the <a href='https://code.statisticsauthority.gov.uk/'>Code of Practice for Statistics</a> and should be labelled ‘accredited official statistics’.\n\nAccredited official statistics are called National Statistics in the <a href='https://osr.statisticsauthority.gov.uk/accredited-official-statistics/'>Statistics and Registration Service Act 2007.</a>"];
