export const sar3_further_information = ["\nThe information presented in this table has been derived from Consolidated Data return (CDR) provided by FE Colleges. Each of the data returns are computerised data files consisting of individual records for each enrolment recorded by FE Colleges during each academic year. Figures are correct as of the 13th of October 2023.\n\nIndividual students are identified using student ID within each college and each academic year. Students can achieve a qualification in more than one course. \n\nOnly students enrolled in their final year on Regulated Level 3 courses are included in this analysis. Those in their final year, who have completed the course and subsequently achieved are regarded as “Students achieving qualifications”. \n\nTo prevent the identification of individuals, figures in the attached tables are rounded to the nearest 5, with 0, 1, 2 rounded to 0.\n\nFrom academic year 2013/14, ‘regulated enrolments’ at ‘level 3 or below’ are regarded as those on courses that are at and appear on the Register of Regulated Qualifications (RRQ), which contains qualifications on both the Qualifications and Credit Framework and the National Qualifications Framework or part of the Department’s Prescribed List of Approved Qualifications (PLAQ)/Access list).\n\n“Level” refers to the nationally recognised qualification level of the course.\n\nAchievements are final year full and partial achievements.\n\nTransfers are excluded from the analysis.\n\nWithdrawals are included where there is an achieved outcome.\n\nIn 2020/21, 2021/22 and 2022/23, where the Outcome code is ‘S’ (COVID affected - outcome deferred to next year), these enrolments are filtered out of all performance analysis, that is Students Enrolled in Final Year and Students Achieving Qualifications.\n\nDue to rounding the sum of numbers in each row or column may not match the total shown.\n\nPercentages are based on unrounded figures and are suppressed if a figure is less than 22.5. Percentages have been rounded to the nearest integer."];
export const sar3_metadata = {dataset : "sar3", table_code : "SARQL3FEEQ", years : "2019/20 - 2022/23", start_year : "2019/20", end_year : "2022/23", geog_level : "ni", dataset_url : "https://data.nisra.gov.uk/table/SARQL3FEEQ", name : "Department for the Economy", id : "EQGRP", email : "dfemail@economy-ni.gov.uk", subject : "Further education", product : "Achievements", title : "Students Achieving Regulated Qualifications at Level 3 in FE Colleges", note : "Students Achieving Regulated Qualifications at Level 3 in FE Colleges\n\nHow do we measure this?\nStudents enrolled in their final year at FE colleges achieving Regulated Level 3 qualifications.\n\nSource\n[url=https://www.economy-ni.gov.uk/articles/further-education-college-statistics]Further education college statistics[/url]\n\nFurther information\r\n\nThe information presented in this table has been derived from Consolidated Data return (CDR) provided by FE Colleges. Each of the data returns are computerised data files consisting of individual records for each enrolment recorded by FE Colleges during each academic year. Figures are correct as of the 13th of October 2023.\n\nIndividual students are identified using student ID within each college and each academic year. Students can achieve a qualification in more than one course. \n\nOnly students enrolled in their final year on Regulated Level 3 courses are included in this analysis. Those in their final year, who have completed the course and subsequently achieved are regarded as “Students achieving qualifications”. \n\nTo prevent the identification of individuals, figures in the attached tables are rounded to the nearest 5, with 0, 1, 2 rounded to 0.\n\nFrom academic year 2013/14, ‘regulated enrolments’ at ‘level 3 or below’ are regarded as those on courses that are at and appear on the Register of Regulated Qualifications (RRQ), which contains qualifications on both the Qualifications and Credit Framework and the National Qualifications Framework or part of the Department’s Prescribed List of Approved Qualifications (PLAQ)/Access list).\n\n“Level” refers to the nationally recognised qualification level of the course.\n\nAchievements are final year full and partial achievements.\n\nTransfers are excluded from the analysis.\n\nWithdrawals are included where there is an achieved outcome.\n\nIn 2020/21, 2021/22 and 2022/23, where the Outcome code is ‘S’ (COVID affected - outcome deferred to next year), these enrolments are filtered out of all performance analysis, that is Students Enrolled in Final Year and Students Achieving Qualifications.\n\nDue to rounding the sum of numbers in each row or column may not match the total shown.\n\nPercentages are based on unrounded figures and are suppressed if a figure is less than 22.5. Percentages have been rounded to the nearest integer.\n\nSection 75 category: Age\nVariable used: Age\nBreakdown available:: 19 and under; 20-24; 25+\n\nAge is calculated at 1st July prior to the start date of enrolment. Where a student has more than one achievement and therefore possibly more than one age calculated, (as the academic year August to July does not quite align with the age taken at 1st July) the youngest age is used in this analysis.\n\nSection 75 category: Men and women generally\nVariable used: Sex\nBreakdown available:: Female; Male \n\nThe student provides their sex at the time of enrolment.\n\nSection 75 category: Marital status\nVariable used: Marital status\nBreakdown available:: Single (never married or never in a legally registered civil partnership); Married or in a legally registered civil partnership; Divorced or formerly in a civil partnership which is now legally dissolved/Separated (but still legally married or still legally in a civil partnership); Widowed or surviving member of a legally registered civil partnership; Unknown\n\nMarital status is supplied by the student at the time of enrolment.\n\nSection 75 category: Persons with a disability and persons without\nVariable used: Disability\nBreakdown available:: Disabled; Not Disabled\n\nInformation on student disability is derived from individuals self-reporting a disability.\n\nSection 75 category: Religious belief\nVariable used: Religious belief\nBreakdown available:: Catholic; Protestant and other Christian religions; Other; No religion; Not stated\n\nReligious belief is self-reported by the student at the time of enrolment.\n\nSection 75 category: Sexual orientation\nVariable used: Sexual orientation\nBreakdown available:: Straight or heterosexual; Gay, lesbian, bisexual or other; Prefer not to say/not stated\n\nSexual orientation is supplied by the student at the time of enrolment.\n\nSection 75 category: Persons with dependants and persons without\nVariable used: Dependants\nBreakdown available:: Has dependants; Does not have dependants\n\n‘With dependants' includes: individuals who have responsibility for the care of: a child(ren); a person with a disability; and/or a dependant elderly person. Dependants is derived from 3 fields: \n\n1. Dependent Adult field - indicates whether the individual has indicated they have responsibility for one or more Dependent adults.\n2. Dependent Children field - indicates whether the individual has indicated they have responsibility for dependent children.\n3. Dependant person with a disability field - indicates whether the individual has indicated they have responsibility for one or more persons with a disability.\n\nSection 75 category: Racial group\nVariable used: Ethnic Group\nBreakdown available:: White; Other; Unknown\n\nDue to low numbers, students of any other ethnic group than white or unknown have been combined into ‘Other’.\n\nEthnicity is supplied by the student at the time of enrolment.\n\nSection 75 category: Political opinion\nBreakdown available:: These data are not collected by the survey"};
