export const sls1_title = ["Qualifications of School Leavers - At least 3 A-levels at grades A*-C (incl. equivalent qualifications)"];
export const sls1_how_do_we_measure = ["Qualifications of students leaving mainstream, grant-aided post-primary schools each academic year, including those who finish after GCSEs or after a period of A-level study."];
export const sls1_source_name = ["Qualifications and Destinations of Northern Ireland School Leavers."];
export const sls1_source_url = ["https://www.education-ni.gov.uk/articles/school-leavers#toc-2"];
export const sls1_further_information = ["\n1. The school-leaving cohort in each academic year comprises Year 12, 13 and 14 pupils leaving mainstream, grant-aided, post-primary schools. It does not include special or independent schools.\nAll school leavers are taken to be in the Age 16+ category.\n\n2. Ethnic Groups: ‘Other’ includes Irish Travellers. 'White' does not include Irish Travellers.\n\n3. The dataset is gathered electronically from schools annually in October/ November via the school administration system. As the school leavers data collection and validation process takes place at the start of the subsequent academic year, it is not possible to collect or validate information for pupils who left schools that closed at the end of the academic year being analysed. This would only relate to a small number of pupils, however, if any.\n\n4. Broadly speaking, each academic year’s cohort of school leavers contains a mix of around one-third of leavers after Key Stage 4 and around two-thirds of leavers after a period of Level 3 study.\n\n5. Analyses of GCSEs (and equivalent qualifications) will, for example, be a mix of attainment in the most recent academic year (for pupils leaving immediately following Key Stage 4) and attainment from previous academic years (for pupils leaving following a period of Level 3 study). \nAs such, the School Leavers Survey cannot be used to analyse examination results, or attainment, achieved in a specific academic year. The School Leavers Survey is, however, appropriate for monitoring the long-term trend of the impact of the Northern Ireland school system on pupil attainment levels.\n\n6. Includes equivalent qualifications.\n\n7. Given the alternative methods of awarding grades in 2019/20 and 2020/21, and the various assessment adaptations and other supports in place for 2021/22 and 2022/23, caution should be taken when drawing any conclusions relating to changes in student performance. \nYear-on-year changes might have been impacted by the different processes for awarding qualifications in these years rather than reflect a change in underlying performance. \nEducation outcomes for school leavers in these affected years are, therefore, not directly comparable with outcomes in any other years (including comparisons with other affected years).\nAs such, attainment levels have generally decreased since 2021/22, reflecting the return toward pre-pandemic awarding arrangements. \n\n<u>Generally, the school leavers data for 2019/20 combines</u>:\n- Centre Assessed Grades, for pupils who left the school system after being awarded GCSEs or A-Levels (and equivalent qualifications) in 2019/20; and\n- GCSE (and equivalent qualification) results for pupils who sat exams in previous years and who left in 2019/20.\n<u>Generally, the data for 2020/21 combines</u>:\n- Centre Determined Grades, for pupils who left the school system after being awarded GCSEs or A-Levels (and equivalent qualifications) in 2020/21; and\n- GCSE (and equivalent qualification) results for pupils who sat exams in years prior to 2019/20 and who left in 2020/21.\n<u>Generally, the data for 2021/22 combines</u>:\n- Results for pupils who left the school system after being awarded GCSEs or A-Levels (and equivalent qualifications), with various assessment adaptations, in 2021/22; and\n- Centre Assessed Grades, for pupils who were awarded GCSEs (and equivalent qualification) in 2019/20 and who left in 2021/22.\n<u>Generally, the data for 2022/23 combines</u>:\n- Results for pupils who left the school system after being awarded GCSEs or A-Levels (and equivalent qualifications), with additional support (Advance Information), in 2022/23; and\n- Centre Determined Grades, for pupils who were awarded GCSEs (and equivalent qualification) in 2020/21 and who left in 2022/23."];
